import React from "react";
import "./home.css"



function Home(){

    return (
    <div className = "writing">
    <h1>Home</h1>
    <h2>Welcome to the badminton home page </h2>
    <p>This is a fan made site which relays information about badminton. </p>
    <img src = "./images/badminton.jpg" alt = "badminton"></img>
    </div>
)
    
}

export default Home;
